import classes from './Description.module.css';

const Description = () => {
  return (
    <div className={classes.description}>
      <div className={classes.description_info}>
        <h3>Mô tả</h3>
        <div>
          <div>
            <h2>THÔNG TIN SẢN PHẨM</h2>
          </div>
        </div>
      </div>
      <div className={classes.info}></div>
    </div>
  );
};

export default Description;
